(5, 'video', NULL, 27, 0, 'com_content', '3W4PSgxDZ2U', 'jpg', 'original/67/75/6c/', 'Apple iPhone 5 vs Samsung Galaxy S III', 'For more details, check out our web site: http://www.phonearena.com/reviews/Apple-iPhone-5-vs-Samsung-Galaxy-S-III_id3142\nIt\'s the battle between the flagships! Two handsets enter, only one can leave claiming supremacy in the smartphone landscape. For a good while now, Samsung\'s pride and joy in the Galaxy S III has been tearing up the scene, and when the Apple iPhone 5 finally became a reality, Samsung made sure to let everyone know that \"the next big thing is already here.\" Talking the talk, we\'re taking these two hotshot smartphones and pitting them against one another, to unequivocally proclaim which device', 612, 0, '{\"image\":{\"format\":\"jpg\",\"width\":480,\"height\":360},\"thumbnail\":{\"65x65c\":{\"format\":\"jpg\",\"width\":\"65\",\"height\":\"65\"},\"300x300s\":{\"format\":\"jpg\",\"width\":300,\"height\":225},\"140x90c\":{\"format\":\"jpg\",\"width\":\"140\",\"height\":\"90\"},\"120x120c\":{\"format\":\"jpg\",\"width\":\"120\",\"height\":\"120\"},\"100x100c\":{\"format\":\"jpg\",\"width\":\"100\",\"height\":\"100\"},\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":74},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 367, '', '', 1407, 0, '2012-11-25 03:30:00', '2012-12-18 00:32:00', 1, 1, 0, '', 1, 0, 0, 0, 0),
(6, 'video', NULL, 27, 0, 'com_content', 'tzwnPm94m58', 'jpg', 'original/44/5b/d4/', 'Apple iPhone 5 Review', 'For more info about the iPhone 5, read our full review here:\nhttp://www.phonearena.com/reviews/Apple-iPhone-5-Review_id3133/page/4\nPhoneArena presents a video review of the iPhone 5 - one of the most anticipated and intriguing phones of the year. The iPhone 5 comes with  new, reworked desihn, a bigger 4\" screen, LTE and a bunch of other stuff that improves on Apple\'s winning formula. Watch our video for the whole story...', 913, 0, '{\"image\":{\"format\":\"jpg\",\"width\":480,\"height\":360},\"thumbnail\":{\"65x65c\":{\"format\":\"jpg\",\"width\":\"65\",\"height\":\"65\"},\"100x100c\":{\"format\":\"jpg\",\"width\":\"100\",\"height\":\"100\"},\"140x90c\":{\"format\":\"jpg\",\"width\":\"140\",\"height\":\"90\"},\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":74},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 367, '', '', 1435, 0, '2012-11-25 03:30:00', '2012-12-18 00:32:00', 1, 1, 0, '', 1, 0, 0, 0, 0),
