(14, 'video', NULL, 27, 0, 'com_content', 'vX_O0WWDRmA', 'jpg', 'original/39/69/ce/', 'Apple iPhone 5 vs Apple iPhone 4S', 'For more details, check out our web site: http://www.phonearena.com/reviews/Apple-iPhone-5-vs-Apple-iPhone-4S_id3138\nWhen the iPhone 4S was unveiled last year, feelings of disappointed started to engulf many people, as it turned out being nothing more than a revamped iPhone 4. Well, one year later, and the industry finally got what it wanted in the iPhone 5 -- regarded by many as the biggest undertaking by Apple since the original back in 2007. Now that it\'s finally here, we bet there are some iPhone 4S owners out there wondering whether it\'s worth the investment to make the upgrade. Let\'s take a peek, shall we?...', 588, 0, '{\"image\":{\"format\":\"jpg\",\"width\":480,\"height\":360},\"thumbnail\":{\"65x65c\":{\"format\":\"jpg\",\"width\":\"65\",\"height\":\"65\"},\"100x100c\":{\"format\":\"jpg\",\"width\":\"100\",\"height\":\"100\"},\"140x90c\":{\"format\":\"jpg\",\"width\":\"140\",\"height\":\"90\"},\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":74},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 367, '', '', 1486, 0, '2012-11-25 03:32:00', '2012-12-18 00:32:00', 1, 1, 0, '', 1, 0, 0, 0, 0),
(15, 'video', NULL, 27, 0, 'com_content', '2TQzdc1tmkU', 'jpg', 'original/61/5b/ae/', 'LG Optimus G vs Apple iPhone 5', 'For more details, check out our web site: \nhttp://www.phonearena.com/reviews/LG-Optimus-G-vs-Apple-iPhone-5_id3155\n\nPhoneArena presents a new video comparison: LG Optimus G vs Apple iPhone 5! On one hand, the Optimus G is super-spec\'d monster of a phone with large screen, Snapdragon S4 Pro processor and 2 gigs of RAM, but on the other, the iPhone 5 features a breath-taking design with a super-high-quality screen and a very easy to use interface. Who\'s going to excel an at what? Watch our video to find out!', 519, 0, '{\"image\":{\"format\":\"jpg\",\"width\":480,\"height\":360},\"thumbnail\":{\"65x65c\":{\"format\":\"jpg\",\"width\":\"65\",\"height\":\"65\"},\"100x100c\":{\"format\":\"jpg\",\"width\":\"100\",\"height\":\"100\"},\"140x90c\":{\"format\":\"jpg\",\"width\":\"140\",\"height\":\"90\"},\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":74},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 367, '', '', 1863, 0, '2012-11-25 03:33:00', '2012-12-18 00:32:00', 1, 1, 0, '', 1, 0, 0, 0, 0),
