(363, 'video', NULL, 84, 0, 'com_content', '7u-HxL2teq4', 'jpg', 'original/97/5a/75/', 'So snh LG Optimus G Pro vs Samsung Galaxy S III', 'For more details, check out our web site: http://www.phonearena.com/reviews/LG-Optimus-G-Pro-vs-Samsung-Galaxy-S-III_id3263\nEven after almost a year since its introduction, the Samsung Galaxy S III remains one of the most sought-after handsets, that\'s why we are staging a quick comparison with LG\'s newest flagship darling, the Optimus G Pro. Granted, being a newer generation device, the G Pro beats the S III in almost every specs category, but Samsung has managed to create its finest future-proof, and keeps it relevant with thoughtful software updates, so let\'s dig in and examine which is the one for you...', 762, 0, '{\"image\":{\"format\":\"jpg\",\"width\":\"\",\"height\":\"\"},\"thumbnail\":{\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":74},\"140x90c\":{\"format\":\"jpg\",\"width\":\"140\",\"height\":\"90\"},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 367, '', '', 1679, 0, '2013-03-12 04:36:00', '2013-03-12 04:37:00', 1, 1, 0, '', 1, 0, 0, 0, 0),
