(555, 'video', NULL, 222, 0, 'com_content', '2CzoSeClcw0', 'jpg', 'original/f0/72/44/', 'Iron Man 3 - Official Trailer (HD)', 'http://www.joblo.com - \"Iron Man 3\" - Official Trailer\n\nMarvel\'s \"Iron Man 3\" pits brash-but-brilliant industrialist Tony Stark/Iron Man against an enemy whose reach knows no bounds. When Stark finds his personal world destroyed at his enemy\'s hands, he embarks on a harrowing quest to find those responsible. This journey, at every turn, will test his mettle. With his back against the wall, Stark is left to survive by his own devices, relying on his ingenuity and instincts to protect those closest to him. As he fights his way back, Stark discovers the answer to the question that has secretly haunted him: does the man make the suit or does the suit make the man?\n\nDirector: Shane Black\n\nCast: Robert Downey Jr., Gwyneth Paltrow, Don Cheadle, Guy Pearce, Rebecca Hall, Stephanie Szostak, James Badge Dale, Jon Favreau, Ben Kingsley\n\nIn theaters: May 3rd, 2013\n\nCopyright  2013 Marvel Studios', 126, 0, '{\"image\":{\"format\":\"jpg\",\"width\":\"\",\"height\":\"\",\"url\":\"https:\\/\\/danhgia.net\\/media\\/reviews\\/videos\\/original\\/f0\\/72\\/44\\/2CzoSeClcw0.jpg\"},\"thumbnail\":{\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":74},\"140x90c\":{\"format\":\"jpg\",\"width\":\"140\",\"height\":\"90\"},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 1031, '', '', 463, 0, '2013-05-07 20:52:00', '2023-04-14 19:07:31', 1, 1, 0, '', 1, 0, 0, 0, 0),
