(798, 'video', NULL, 332, 0, 'com_content', 'mtBccJPj4Jc-v1370512867', 'jpg', 'original/e0/50/d3/', 'Fast & Furious 6: The Game', 'Step into the world of Fast & Furious 6. Earn cash and the respect of the \"Fastest\" drivers as you drift and drag through the London street scene. Join the Fast & Furious crew as they prepare to take on a series of jobs in an all new heist mode. Fast & Furious 6: The Game takes the mobile racing genre to greater heights with stunning graphics, new game modes, addictive challenges and intense fullthrottle missions that dare you to exceed all limits.\n\nJOIN THE FAST & FURIOUS 6 CREW\nTake down an organization of lethally skilled mercenary drivers to earn respect as you drift and drag through the streets of London.\n\nYOUR RIDES\nCollect, customize and upgrade a slew of high end licensed vehicles that range from the classic 1970 Dodge Charger to the super cars of today all featuring stunning graphics.\n\nPULL OFF ONE LAST JOB, OR TWO\nEarn big cash and unlock the next tier upgrades in heists with the Fast & Furious 6 crew\n\nCOMPETE\nJump into tournaments or join a crew and take on the world by dominating the global leaderboards', 31, 0, '{\"image\":{\"format\":\"jpg\",\"width\":\"\",\"height\":\"\"},\"thumbnail\":{\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":74},\"140x90c\":{\"format\":\"jpg\",\"width\":\"140\",\"height\":\"90\"}}}', 'youtube', 367, '', '', 607, 0, '2013-06-06 10:01:00', NULL, 1, 1, 0, '', 1, 0, 0, 0, 0),
