(956, 'video', NULL, 488, 0, 'com_content', 'IbXaAu6kgNc-v1372188914', 'jpg', 'original/fd/fd/3a/', 'WARGAME AIRLAND BATTLE: LAUNCH TRAILER', 'Get it on Steam: http://store.steampowered.com/app/222750\nSite: http://www.wargame-ab.com/\nFaceBook: https://www.facebook.com/WargameRTS\nTwitter: https://twitter.com/WargameRTS\n\nThe RTS Bomb is Back! Wargame AirLand Battle, the sequel to the spectacular real-time strategy game, Wargame European Escalation from Eugen Systems, today celebrates its worldwide release on PC with an explosive launch trailer.\n\nMore than a sequel to European Escalation, Wargame AirLand Battle offers vast, rich content: even more spectacular battles on bigger, more varied maps with impressive landscapes, over 800 ultra-detailed combat units of all kind to create your own armies, an innovative and fascinating dynamic campaign, and a comprehensive multiplayer mode in which up to 20 players can battle simultaneously.\n\nThis is the day that new players of Wargame will finally be able to join the battlefields of Wargame AirLand Battle, on which dozens of thousands of players have already waged war thanks to the early-access multiplayer Beta. For all players who pre-ordered the game, their early-access Beta version will be automatically transformed into the full version of game at release time, unlocking the game\'s massive amount of content, and notably its fascinating dynamic campaign!\n\nThe World is at War again! Wargame AirLand Battle will be released today for PC.', 66, 0, '{\"image\":{\"format\":\"jpg\",\"width\":\"\",\"height\":\"\"},\"thumbnail\":{\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":74},\"140x90c\":{\"format\":\"jpg\",\"width\":\"140\",\"height\":\"90\"}}}', 'youtube', 968, '', '', 766, 0, '2013-06-25 19:35:00', NULL, 1, 1, 0, '', 1, 0, 0, 0, 0),
