(1073, 'video', NULL, 563, 0, 'com_content', 'UhxSOkTFGvo-v1373476537', 'jpg', 'original/8f/43/17/', 'Free Birds - Official Trailer (HD) Owen Wilson', 'http://www.joblo.com - \"Free Birds\" - Official Trailer (HD) Owen Wilson\n\nIn this hilarious, adventurous buddy comedy for audiences of all ages, directed by Jimmy Hayward (Horton Hears a Who!), two turkeys from opposite sides of the tracks must put aside their differences and team up to travel back in time to change the course of history - and get turkey off the Thanksgiving menu for good.\n\nDirector: Jimmy Hayward\n\nCast: Woody Harrelson, Owen Wilson, Amy Poehler, Dan Fogler, George Takai, Eddie \"Piolin\" Sotelo\n\nWriters: David I. Stern and John Strauss, rewrite by Craig Mazin', 153, 0, '{\"image\":{\"format\":\"jpg\",\"width\":\"\",\"height\":\"\",\"url\":\"https:\\/\\/danhgia.net\\/media\\/reviews\\/videos\\/original\\/8f\\/43\\/17\\/UhxSOkTFGvo-v1373476537.jpg\"},\"thumbnail\":{\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":74},\"140x90c\":{\"format\":\"jpg\",\"width\":\"140\",\"height\":\"90\"},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 968, '', '', 1243, 0, '2013-07-10 17:15:00', '2023-04-14 18:36:58', 1, 1, 0, '', 1, 0, 0, 0, 0),
