(1158, 'video', NULL, 170, 0, 'com_content', 'WEbzZP-_Ssc-v1374942151', 'jpg', 'original/4e/8e/44/', 'The Wolverine: International Trailer', 'Watch the official trailer, starring Hugh Jackman! In cinemas July 25th 2013\n\nLike us on Facebook - www.facebook.com/TheWolverineMovie\nFollow us on Twitter - @TheWolverineUK\n\nBased on the celebrated comic book arc, this epic action-adventure takes Wolverine (Hugh Jackman), the most iconic character of the X-Men universe, to modern day Japan.  Out of his depth in an unknown world he will face a host of unexpected and deadly opponents in a life-or-death battle that will leave him forever changed.  Vulnerable for the first time and pushed to his physical and emotional limits, he confronts not only lethal samurai steel but also his inner struggle against his own immortality.', 148, 0, '{\"image\":{\"format\":\"jpg\",\"width\":\"\",\"height\":\"\"},\"thumbnail\":{\"140x90c\":{\"format\":\"jpg\",\"width\":\"140\",\"height\":\"90\"},\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":75},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 367, '', '', 1382, 11578, '2013-07-27 16:22:00', '2013-07-27 16:22:00', 1, 1, 0, '', 1, 0, 0, 0, 0),
