(1234, 'video', NULL, 614, 0, 'com_content', 'sY1TLgqfjvw-v1376211588', 'jpg', 'original/03/e0/19/', 'The Drive Movie Trailer 2011 Official Ryan Gosling', 'The Drive Movie Trailer 2011 Official HD - Ryan Gosling\n\nThe Drive Movie 2011 brief: Danish director Nicolas Winding Refn (BRONSON, THE PUSHER trilogy, VALHALLA RISING) throttles into the Hollywood fast lane with precision-crafted crime caper Drive. Ryan Gosling stars as a Los Angeles wheelman for hire, stunt driving for movie productions by day and steering getaway vehicles for criminal operations by night. A loner by nature, Driver can\'t help falling in love with his beautiful but vulnerable neighbor Irene (Carey Mulligan), a young mother dragged into a dangerous criminal underworld by the return of ex-convict husband Standard (Oscar Isaac). After a heist operation, intended to help Standard pay off protection money, spins out of control, Driver finds himself driving defense for the girl he loves, tailgated by a syndicate of deadly serious criminals (Albert Brooks and Ron Perlman). When the gangsters reveal that they\'re after more than the bag of money in his trunkthat they\'re coming straight for Irene and her sonDriver is forced to shift gears and go on the offense. DRIVE was written by Hossein Amini, adapted from a book by James Sallis, and produced by Marc Platt, Gigi Pritzker, Michel Litvak, Adam Siegel and John Palermo; executive producers are David Lancaster, Gary Michael Walters, Bill Lischak and Linda McDonough. The Drive trailer 2011 is presented in full HD 1080p high resolution.\n\nThe Drive Movie Trailer 2011 Official Ryan Gosling\nRelease Date: September 16th, 2011.\nStarring: Ryan Gosling, Carey Mulligan, Bryan Cranston, Albert Brooks, Oscar Isaac, Ron Perlman and Christina Hendricks\nDirected By: Nicolas Winding Refn\n\nThe Drive movie trailer, 2011 official, courtesy FilmDistrict.\n\nYour daily dose of everything movies. Our passionate team of producers bring you the best of officially licensed movie trailers, clips and featurettes.', 151, 0, '{\"image\":{\"format\":\"jpg\",\"width\":\"\",\"height\":\"\"},\"thumbnail\":{\"65x65c\":{\"format\":\"jpg\",\"width\":\"65\",\"height\":\"65\"},\"140x90c\":{\"format\":\"jpg\",\"width\":\"140\",\"height\":\"90\"},\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":75},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 1031, '', '', 1512, 0, '2013-08-11 08:59:00', NULL, 1, 1, 0, '', 1, 0, 0, 0, 0),
