(1256, 'video', NULL, 615, 0, 'com_content', 'L9szn1QQfas-v1376214666', 'jpg', 'original/84/18/d5/', 'TRON: LEGACY Official Trailer', 'Become a fan on facebook and order here: http://on.fb.me/fUYGl1\r\n\r\nTron: Legacy is available now on Four-Disc Blu-ray 3D/Blu-Ray and DVD Combo. \r\n\r\nFollow TRON: Legacy on Twitter:  http://twitter.com/TronLegacy \r\n\r\nTRON: LEGACY is a 3D high-tech adventure set in a digital world that\'s unlike anything ever captured on the big screen. Sam Flynn (Garrett Hedlund), a rebellious 27-year-old, is haunted by the mysterious disappearance of his father Kevin Flynn (Oscar- and Golden Globe-winner Jeff Bridges), a man once known as the world\'s leading video-game developer. When Sam investigates a strange signal sent from the old Flynn\'s Arcadea signal that could only come from his fatherhe finds himself pulled into a digital world where Kevin has been trapped for 20 years. With the help of the fearless warrior Quorra (Olivia Wilde), father and son embark on a life-or-death journey across a visually-stunning cyber universea universe created by Kevin himself that has become far more advanced with never-before-imagined vehicles, weapons, landscapes and a ruthless villain who will stop at nothing to prevent their escape. Presented in Disney Digital 3D and scored by Grammy Award-winning electronic music duo Daft Punk.', 141, 0, '{\"image\":{\"format\":\"jpg\",\"width\":\"\",\"height\":\"\"},\"thumbnail\":{\"65x65c\":{\"format\":\"jpg\",\"width\":\"65\",\"height\":\"65\"},\"140x90c\":{\"format\":\"jpg\",\"width\":\"140\",\"height\":\"90\"},\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":75},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 1031, '', '', 1471, 0, '2013-08-11 09:51:00', NULL, 1, 1, 0, '', 1, 0, 0, 0, 0),
