(1337, 'video', NULL, 630, 0, 'com_content', 'cdnoqCViqUo-v1377368970', 'jpg', 'original/d4/8e/31/', 'The Internship - Official Trailer (HD)', 'http://www.joblo.com - \"The Internship\" - Official Trailer\n\nBilly (Vince Vaughn) and Nick (Owen Wilson) are salesmen whose careers have been torpedoed by the digital world. Trying to prove they are not obsolete, they defy the odds by talking their way into a coveted internship at Google, along with a battalion of brilliant college students. But, gaining entrance to this utopia is only half the battle. Now they must compete with a group of the nation\'s most elite, tech-savvy geniuses to prove that necessity really is the mother of re-invention.\n\nIn theaters: June 7, 2013\n\nLink: www.theinternshipmovie.com\n\nTwo recently laid-off men in their 40s try to make it as interns at a successful Internet company where their managers are in their 20s.\n\nDirector: Shawn Levy\n\nWriters: Jared Stern, Vince Vaughn\n\nStars: Owen Wilson, Vince Vaughn, Rose Byrne\n\nCopyright @ 20th Century Fox', 152, 0, '{\"image\":{\"format\":\"jpg\",\"width\":\"\",\"height\":\"\",\"url\":\"https:\\/\\/danhgia.net\\/media\\/reviews\\/videos\\/original\\/d4\\/8e\\/31\\/cdnoqCViqUo-v1377368970.jpg\"},\"thumbnail\":{\"65x65c\":{\"format\":\"jpg\",\"width\":\"65\",\"height\":\"65\"},\"140x90c\":{\"format\":\"jpg\",\"width\":\"140\",\"height\":\"90\"},\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":75},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 367, '', '', 1576, 0, '2013-08-24 18:29:00', '2022-12-31 15:59:56', 1, 1, 0, '', 1, 0, 0, 0, 0),
