(1375, 'video', NULL, 1558, 0, 'com_content', 'vr6DETPBxbI-v1377659460', 'jpg', 'original/1d/ae/32/', 'Toshiba Satellite P50 Laptop', 'The 39.6 cm (15.6\") Satellite P50 series offers stunning design combined with powerful performance, leading entertainment features and full Windows 8 touchscreen interface. Its stylish design includes a silver brushed aluminium chassis with a tiled keyboard and large touchpad with integrated buttons for ease of use. Performance is enhanced with the latest processing power and nVIDIA graphics technology whilst premium Harman Kardon speakers combine with DTS Studio Sound audio suite to offer stunning sound quality. Extensive connectivity options are also included as standard. An optional Full HD 1920x1080p screen allows you to view movies, photos, web pages and games with vibrant definition and pinpoint clarity.\n\nMore info: http://www.toshiba.co.uk/laptops/satellite/p50/\n\nhttp://www.toshiba.co.uk\nhttp://www.facebook.com/toshibauk\nhttp://www.twitter.com/toshibauk', 116, 0, '{\"image\":{\"format\":\"jpg\",\"width\":\"\",\"height\":\"\"},\"thumbnail\":{\"65x65c\":{\"format\":\"jpg\",\"width\":\"65\",\"height\":\"65\"},\"140x90c\":{\"format\":\"jpg\",\"width\":\"140\",\"height\":\"90\"},\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":75},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 367, '', '', 1273, 0, '2013-08-28 03:11:00', NULL, 1, 1, 0, '', 1, 0, 0, 0, 0),
