(1383, 'video', NULL, 1559, 0, 'com_content', 'uTWCRP8ZuZc-v1377661288', 'jpg', 'original/80/c3/28/', 'HTC Butterfly S Review Part 1', 'HTC Butterfly S Review Part 1\n\nAaron reviews the HTC Butterfly S, the Taiwanese cousin of the HTC One with some impressive improvements under the hood.  Available now in select countries, the Butterfly S packs a 1.9 GHz quad-core Snapdragon 600 CPU, 5-inch 1080p HD display, 4-ultrapixel camera with 1080p HD recording, 2 GB of RAM, 16 GB of internal storage, 3,200 mAh battery, and Android 4.2.2. Jelly Bean with HTC Sense 5.  \n\nWhile you lose the metal exterior, the Butterfly S brings some huge improvements over the HTC One, including a display that\'s the same size as the Galaxy S 4\'s and a much larger 3,200 mAh battery.  The downside is the cost - with no carrier availability in the US, the unlocked price of the HTC Butterfly S sits at about $800.  Larger display, larger battery - and larger price point.  Is it worth it?  Part 1 of 2.\n\nIf you\'d like to purchase the HTC Butterfly S, you can do so at Negri Electronics!\n\nFacebook: http://www.facebook.com/phonedog  \n\nTwitter: http://www.twitter.com/phonedog\n\nGoogle+: http://gplus.to/phonedog\n\nVote For Your Favorite Smartphone: http://www.phonedog.com/rankings\n\nWin Free Phones: http://instantwin.phonedog.com/', 419, 0, '{\"image\":{\"format\":\"jpg\",\"width\":\"\",\"height\":\"\"},\"thumbnail\":{\"65x65c\":{\"format\":\"jpg\",\"width\":\"65\",\"height\":\"65\"},\"140x90c\":{\"format\":\"jpg\",\"width\":\"140\",\"height\":\"90\"},\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":75},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 367, '', '', 1362, 0, '2013-08-28 03:41:00', NULL, 1, 1, 0, '', 1, 0, 0, 0, 0),
