(1707, 'video', NULL, 1679, 0, 'com_content', 'npvJ9FTgZbM-v1384762078', 'jpg', 'original/e9/fb/db/', 'Thor: The Dark World Official Trailer HD', 'Thor, the Mighty Avenger, returns to the big screen in Marvel\'s \"Thor: The Dark World\" on November 8, and here is the official trailer, presented first on YouTube for Geek Week! See Thor, Loki, Jane Foster, Malekith and more in this epic trailer for the film!\n\nLike Thor on Facebook: https://www.facebook.com/Thor\nFollow Thor on Twitter: https://twitter.com/ThorMovies\n\nSubscribe to Marvel: http://bit.ly/WeO3YJ\n\nKeep up with Marvel on:\nTWITTER: https://twitter.com/marvel\nFACEBOOK: http://www.facebook.com/Marvel\nTUMBLR: http://marvelentertainment.tumblr.com/\nINSTAGRAM: http://instagram.com/marvel\nGOOGLE+: https://plus.google.com/+marvel/\nPINTEREST: http://pinterest.com/marvelofficial/', 151, 0, '{\"image\":{\"format\":\"jpg\",\"width\":\"\",\"height\":\"\"},\"thumbnail\":{\"65x65c\":{\"format\":\"jpg\",\"width\":\"65\",\"height\":\"65\"},\"140x90c\":{\"format\":\"jpg\",\"width\":\"140\",\"height\":\"90\"},\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":75},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 1623, '', '', 1341, 3, '2013-11-18 08:07:00', NULL, 1, 1, 0, '', 1, 0, 0, 0, 0),
(1708, 'video', NULL, 1679, 0, 'com_content', '7p7rocHEecE-v1384762085', 'jpg', 'original/cf/d3/e7/', 'Thor: The Dark World teaser trailer UK -- Official Marvel | HD', 'The first official trailer for Thor: The Dark World - in UK cinemas Oct 30. The sequel to Marvel\'s Thor, starring Chris Hemsworth, Natalie Portman, Tom Hiddleston and Christopher Eccleston.\n\nFor the latest on Thor: The Dark World, \'Like\' us on Facebook: http://www.facebook.com/MarvelUK\n\nMarvel\'s Thor: The Dark World continues the big-screen adventures of Thor, the Mighty Avenger, as he battles to save Earth and all the Nine Realms from a shadowy enemy that predates the universe itself.  In the aftermath of Marvel\'s Thor and Marvel\'s Avengers Assemble,Thor fights to restore order across the cosmos...but an ancient race led by the vengeful Malekith returns to plunge the universe back into darkness.  Faced with an enemy that even Odin and Asgard cannot withstand, Thor must embark on his most perilous and personal journey yet, one that will reunite him with Jane Foster and force him to sacrifice everything to save us all. \n\nStarring Chris Hemsworth, Natalie Portman, Tom Hiddleston, Stellan Skarsgrd, Idris Elba, Christopher Eccleston, Adewale Akinnuoye-Agbaje, Kat Dennings, Ray Stevenson, Zachary Levi, Tadanobu Asano and Jaimie Alexander with Rene Russo and Anthony Hopkins as Odin, Marvel\'s \"Thor: The Dark World\" is directed by Alan Taylor, produced by Kevin Feige, from a story by Don Payne and screenplay by Christopher Yost and Christopher Markus & Stephen McFeely and is based on Marvel\'s classic Super Hero Thor, who first appeared in the comic book \"Journey into Mystery \" #83 in August, 1962.', 119, 0, '{\"image\":{\"format\":\"jpg\",\"width\":\"\",\"height\":\"\"},\"thumbnail\":{\"65x65c\":{\"format\":\"jpg\",\"width\":\"65\",\"height\":\"65\"},\"140x90c\":{\"format\":\"jpg\",\"width\":\"140\",\"height\":\"90\"},\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":75},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 1623, '', '', 1370, 3, '2013-11-18 08:08:00', NULL, 1, 1, 0, '', 1, 0, 0, 0, 0),
