(2078, 'video', NULL, 1842, 0, 'com_content', 'hjwB7Y5nWXY-v1518451052', 'jpg', 'original/68/b1/6a/', 'CN CHUN B G CHO BUI TP U TIN TI GETFIT GYM & YOGA?', 'VI NHNG BN CN PHN VN KHNG BIT NN CHUN B G KHI N PHNG GYM LN U TIN.\nHY THEO DI CLIP SAU  KHI QUT NHNG G CN THIT CHO BUI TP U TI GETFIT GYM & YOGA NH. \n1. Chun b trang b cn thit nh: \n-  Qun o c cht liu co gin cho mc ch tp th thao\n-  Giy\n- Khn\n- Nc\n- Bao tay , ai qun, tht lng,... ( ty theo tng mc ch tp luyn)\n2. B sung dinh dng trc bui tp t nht 60 pht.\n3. Khi ng k trc khi tp\n4. Trong lc tp phi tch cc tp luyn tng dn cng . Lun b sung nc sau mi hip tp.\n5. Th lng c th ngay sau tp  h tr qu trnh phc hi sau  ca c bp.\n---\nGetfit Gym & Yoga vi din tch gn 2500 m2 ta lc ti trung tm thnh ph.\nVi c s vt cht cng h thng my tp cao cp vi tng khu vc ring bit p ng a dng v chuyn su nhu cu tp gym ca tng hi vin. \ni ng nhn vin t vn nhit tnh, Hun luyn vin c o to chuyn nghip v cc dch v tin ch i km nh:\nPhng xng hi t/kh gip gii ta cng thng sau nhng gi lm vic mt mi.\nKhu Locker sang trng.\nQuy Bar vi ngun thc phm dinh dng dnh ring cho th thao....\nLun p ng ti a nhu cu ca Hi vin trc v sau khi tp. Getfit Gym & Yoga cam oan cht lng phc v cng nh s hi lng ca khch hng lun l s u tin hng u.\n', 102, 0, '{\"image\":{\"format\":\"jpg\",\"width\":\"\",\"height\":\"\"},\"thumbnail\":{\"65x65c\":{\"format\":\"jpg\",\"width\":65,\"height\":65},\"640x460s\":{\"format\":\"jpg\",\"width\":480,\"height\":360},\"150x120c\":{\"format\":\"jpg\",\"width\":150,\"height\":120},\"140x90c\":{\"format\":\"jpg\",\"width\":140,\"height\":90},\"208x118c\":{\"format\":\"jpg\",\"width\":208,\"height\":118},\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":75},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 31314, '', '', 533, 20383171, '2018-02-12 15:57:32', '2018-02-12 15:58:00', 1, 1, 1, '', 1, 0, 0, 0, 0),
