(28, '', '', '- Cu trc chc chn v thit k cht lng tt\n- Thi lng pin tuyt vi\n- Cc cng USB kch thc chun\n- C kh nng chy ng thi hai ng dng\n- Vi x l li t tc  1.3 GHz\n- RAM ln (2GB) ', '- Mn hnh p nhng c  phn gii thp\n- Kh nng chp nh v quay phim km\n- S lng cc ng dng ca bn th 3 rt hn ch\n- Mt  im nh ca mn hnh thp (148 ppi)\n- My nh thiu tnh nng t ng ly nt\n- My nh thiu n flash ', ''),
