(620, '', '', 'Khng gian tuyt vi, ton trai xinh gi p t hi vin ti nhn vin\nC th coi l phng tp 5* sang hn  khu Trung Ho Nhn Chnh ny lun. R&B th qu ni ri, ton trai xinh gi p hot girl hot boy lui ti. M c th l anh idol ca mnh cng ti tp ch ny lun. Nm trn tng 3 to 29T1, view xung ng & cc to chung c khc thi, ko c g qu l.\n\nCc lp tp c update hng tun trn facebook, trong khi website li gn nh b khng v ch c thng tin g. Hun luyn vin cc lp nhit tnh & tp rt mnh m dt khot, thi  cng chuyn nghip. T my mc, phng tm, xng hi n nhn vin u ok. Snh l tn c 1 bng gh sofa di mu  rc lun mi chu, n tng ngay tc th.\n\n\n\n', 'Gi tp hi cao', 'http://phuot9.com/list-cac-phong-gym-co-review-tot-tren-toan-quoc.html'),
(618, '', '', 'C dng vin d s dng, d mang theo c th ung  bt k u.         \nVin to bin c nhiu tc dng vi sc khe nh bi b c th, phng bnh, \nHu ht mi ngi u c th s dng to bin spirulina nht bn 2200 vin\nL thc phm sch t thin nhin, c th d hp th, khng c tc dng ph.\nMc gi kh tt vi mt sn phm c nhiu tc dng.', 'C v tanh kh ung\nNhiu hng gi, hng nhi', 'http://suckhoesacdep.vn/tin-tuc/review-tao-xoan-Nhat-Ban-tao-xoan-spirulina-nhat-ban-2200-vien.html'),
(621, '', '', 'Khng gian p, phng tp cht lng,\nMt trong nhng phng tp c view p v thong nht H Ni. Phng tp rng, thong v thch nht l c tm nhn rng. t phng tp c c view p nh phng tp ny.\n\nMnh thch nht dn my chy c b tr dc bn cnh mng tng knh. Va chy va ngm cnh kh thoi mi, ch khng b p mt vo b tng hay phi cm mt vo my chy (mnh khng thch xem tv hay lt net khi tp lm, bn cnh , vic ci xung nhn mn hnh my chy cng khin cho t th chy khng c chun).\nDn Half rack cng c b tr  ni nhn ra khong khng gia cc ta nh. Rt p (nh hnh)\n\nMy tp th ch yu ca Techno. p, xn. Nhng nu bn nh con hn mnh th c th s c tr ngi nht nh v kch thc my kh to.', 'Gi hi cao', 'http://phuot9.com/list-cac-phong-gym-co-review-tot-tren-toan-quoc.html'),
