(625, '', '', 'Phng tp strength qu tt so vi mc gi, c setup c ch ch cho powerlifting nn anh em yn tm.\ngi c v phng tp n nht trong khu vc H ng\nPhng tp p, sch, t color block mu m chch cho thch hp check in.', '', ''),
