(627, '', '', 'C s vt cht khang trang, tin nghi, mang li cho bn cm gic thoi mi trong thi gian luyn tp.\nPhng tp c thit k rng ri, bi tr hin i v c nhiu trang thit b tp luyn th dc cao cp, p ng mi nhu cu tp luyn ca hc vin.\nThi gian tp linh hot ph hp vi cc hi vin chuyn nghip ln khng chuyn, m ca tt c cc ngy trong tun.\nTp luyn thng xuyn s gip bn c mt vc dng thon gn, mt c th do dai  hc tp v lm vic.\nHc vin c s dng min ph tt c cc dch v h tr nh tu ca nhn, internet', '', ''),
(628, '', '', 'Vi din tch hn 1000m2 , phng tp c khng gian rng ri thong, c chia thnh cc khi ring bit dnh cho nam v n nh: sauna (xng kh), steambath (xng t).\n- Phng tp c trang b hn 100 loi my tp hin i nhm p ng nhu cu luyn tp ca hc vin.\n- Vi i ng HLV chuyn nghip v nhit tnh hng dn hc vin s dng my, bi tp c bn trong bui tp u tin, nhng bui tp sau HLV s hng dn bt c khi no khch c nhu cu.\n- Hc vin c s dng t ng  v cc trang thit b  phng tp min ph.', '', 'http://phongtap.thehinh.com/phong-tap-gym/phong-tap-the-hinh-nha-van-hoa-thanh-nien-youth-gym-quan-1'),
(629, '', '', 'SLife Gym Fitness & Yoga Center mang gii php tp luyn v kin thc dinh dng khoa hc tt nht trn th gii n vi hc vin, mang li c th khe mnh, thn hnh p ng chun v tm hiu thng tin cn thit v ch  dinh dng ph hp.\nSLife t ho l trung tm tin phong mang chng trnh tp luyn khoa hc, c mua bn quyn t M, mang n gii php tp luyn v dinh dng ti u nht, c thit k cho tng c nhn, cho c ngi ln v tr em,  c kim chng bi cc ngi sao hng A ca Hollywood.\ni ng nhn s tr, thn thin, nng ng, yu ngh c trnh  chuyn mn cao, phong cch lm vic chuyn nghip lun sn sng t vn, h tr mi vn  v sc khe cho khch hng. Hun luyn vin c nhn c bng cp chuyn mn tp luyn, dinh dng khoa hc, i ng ch cht l nhng kin tng th thao cp quc gia.\nHc vin c kim tra cc ch s c th. o ch s c th bng my Inbody 270 xc nh lng c, m, cn nng, ch s BMR, t  xc nh nguyn nhn, tnh trng ca tng hc vin v a ra gii php ph hp.\n100% trang thit b tp luyn c nhp khu hon ton t M, m bo an ton trong qu trnh tp luyn ca hi vin.\nS Life YOGA c nhiu kha hc t c bn ti chuyn su, trong khng gian tp rng ri vi nhiu cy xanh. Ging vin l nhng ngi c bng cp, chng ch trong yoga. C nhiu nm kinh nghim ging dy cho hng ngn hc vin trong v ngoi nc. Ngoi ra, bn s c phc v khn ring, detoxhon ton min ph.\nKhng gian ti phng tp ca SLife c thit k m, nhiu cy xanh, rng ri, thong mt, thn thin vi mi trng.', '', 'http://phongtap.thehinh.com/phong-tap-gym/phong-tap-slife-gym-fitness-yoga-center-cach-mang-thang-8-tan-binh'),
(630, '', '', 'Phng tp Gym Dr.Fitness l trung tm Fitness & Yoga kt hp y t theo tiu chun 05 sao.\nHun luyn vin c nhn chuyn nghip c o to theo gio trnh Fitness & y t. Lp hc Yoga c hun luyn vin Jitendra Gill n t n  c nhiu nm kinh nghim, hng dn bi bn, tn tnh.\nKhng gian thit k sang trng, trang thit b my mc hin i, cao cp.\nTin nghi vi khu vc internet, khu vc gi tr, phng xng hi, quy bar phc v cc mn n v thc ung thm ngon, dinh dng.', '', 'http://phongtap.thehinh.com/phong-tap-gym/phong-tap-gym-dr-fitness-go-vap-tphcm'),
